import { Button } from '@mui/material'
import React from 'react'
import { User } from './User'

interface userProps {
    user : User
}

const UserItem = ({user}: userProps) => {
    return (
        <div>
            <Button size="" variant="contained">
                {user.data}
            </Button>

        </div>
    )
}

export default UserItem;
